import React, { useEffect } from 'react';

import './Home.scss';
import MyCarousel from "../../molecules/Carousel/MyCarousel";

const Home = () => {

    useEffect ( () => {
        document.title = "Logistikdienstleister f체r Transport in Delmenhorst | K채fer Logistik";
    }, []);


    return (
        <div className="Home">
            <h1  className="Headline Animated-Text">
                Container-Logistik von ihrer besten Seite
            </h1>

            <MyCarousel/>

        </div>
    );
};

export default Home;
